import styled from 'styled-components'
import {
  Container,
  Content,
  Title,
  Subtitle,
  Paragraph,
} from '../components/Components'

const Homepage = ({ styles }) => {
  return (
    <Container>
      <Content>
        <Header>
          <Paragraph size={styles.paragraphs.p1}>Ann√©es 2021-2024</Paragraph>
        </Header>
      </Content>
    </Container>
  )
}

const Header = styled.header`
  height: 60px;
  display: block;
  display: flex;
  justify-content: flex-end;
  align-items: center;
`

export default Homepage
